    return (
        <View>
        <Button title="Add a color!"/>
        <View style={{ 
            height: 100, width: 100, backgroundColor: 'rgb(0,255,'
        }} />
        </View>
    )
}

const styles = StyleSheet.create ({
    colorStyle: {
        fontSize: 20
    }
})

export default ColorScreen
